        "PrivacyPolicyDetails": MessageLookupByLibrary.simpleMessage(
            "مرحباً! كمستخدم ضيف، يمكنك استكشاف أجزاء كثيرة من التطبيق دون إنشاء حساب. خصوصيتك وسلامتك مهمة جداً بالنسبة لنا. تشرح هذه السياسة كيفية جمع المعلومات واستخدامها وحمايتها داخل التطبيق.\n\n١. المعلومات التي قد نجمعها\n\nحتى بدون تسجيل، قد يجمع التطبيق بيانات تقنية محدودة مثل:\n\n- نوع الجهاز ونظام التشغيل وإصدار التطبيق\n- الإجراءات داخل التطبيق (النقرات، الصفحات التي تمت زيارتها، عمليات البحث)\n- تفضيلات العقارات المحفوظة محلياً (المخزنة فقط على جهازك)\n\nنحن لا نجمع تفاصيل شخصية مثل الاسم أو البريد الإلكتروني أو رقم الهاتف ما لم تختار التسجيل لاحقاً.\n\n٢. كيف نستخدم البيانات\n\nتساعدنا البيانات التي تم جمعها في:\n\n- تحسين تجربة التطبيق\n- إصلاح الأخطاء وتحسين الأداء\n- عرض العقارات ذات الصلة والمكاتب القريبة\n- تذكر قائمة الرغبات المؤقتة واختياراتك على جهازك\n\n٣. صور العقارات ومحتوى المكتب\n\nإذا كنت تتصفح قوائم العقارات أو تحميلات المكتب:\n\n- يتم عرض الصور من خوادم تخزين آمنة\n- نحن لا نعدل أو نحلل محتوى الصورة بخلاف تقديمها في التطبيق\n- لا يتم استخراج بيانات وصفية شخصية من الصور\n\n٤. قائمة الرغبات والتخزين المؤقت\n\nكضيف:\n\n- يمكنك حفظ العقارات في قائمة الرغبات، المخزنة فقط محلياً على جهازك\n- إذا قمت بإنشاء حساب لاحقاً، فقد يعرض النظام نقلها إلى ملف التعريف الخاص بك (بموافقتك)\n\n٥. مشاركة البيانات\n\nنحن لا نقوم أبداً بـ:\n\n- بيع أو مشاركة بياناتك الشخصية للتسويق\n- تقديم سجلات نشاط الضيف لأطراف ثالثة\n- مشاركة تفاصيل الاتصال بالمكتب بخلاف ما ينشره المكتب بالفعل داخل التطبيق\n\nقد نشارك فقط بيانات تحليلات مجهولة المصدر وغير قابلة للتحديد لقياس اتجاهات استخدام التطبيق العامة.\n\n٦. تدابير الأمان\n\nللحفاظ على أمان بياناتك، نستخدم:\n\n- اتصالات مشفرة (HTTPS)\n- تخزين صور محمي بقواعد وصول آمنة\n- فحوصات أمان الخادم المنتظمة\n- وصول مقيد لقاعدة البيانات فقط للمطورين المصرح لهم\n\n٧. روابط خارجية\n\nقد يحتوي التطبيق على روابط لـ:\n\n- مواقع المكاتب\n- خرائط أو أزرار اتصال\n\nسيتبع فتح هذه الخدمات سياسات الخصوصية الخاصة بها. نحن لسنا مسؤولين عن البيانات التي يتم التعامل معها خارج التطبيق.\n\n٨. حقوقك\n\nيمكنك:\n\n- التصفح بأمان دون أن يتم تتبعك شخصياً\n- مسح قائمة الرغبات الخاصة بك في أي وقت من التطبيق\n- اختيار عدم تقديم أي بيانات شخصية حتى تقوم بالتسجيل\n\n٩. الموافقة\n\nباستخدام التطبيق، فإنك توافق على أن:\n\n- يتم جمع بيانات تصفح الضيف بشكل مجهول\n- يتم تخزين بيانات قائمة الرغبات فقط على جهازك\n\n١٠. تحديثات هذه السياسة\n\nقد نقوم بتحديث هذه السياسة لتحسين الوضوح أو الأمان. ستظهر التحديثات داخل التطبيق. الاستخدام المستمر يعني قبول الشروط المحدثة.\n\nاتصل بنا\n\nإذا كان لديك أسئلة حول الخصوصية أو الأمان، يمكنك الوصول إلى الدعم من قسم \"اتصل بنا\" في التطبيق."),
